import React from 'react';
import {PriceCardDisplayV} from './src/PriceCardWidget';


const pricingTable = [
  {
    "key": "standard-package",
    "header": "Standard",
    "title":"Great place to start small projects",
    "subtitle":"AS LOW AS",
    "amount":"$28 /month",
    "backgroundColor":"linear-gradient(to top right, #1A329E, #95A6EE)",
    "buttonTitle": "Choose Plan",
    "buttonStyle": {
    },
    "bodyContent": [
      {
        "li": "Core Elastic Stack security features",
      },
      {
        "li": "Capabilities such as Elastic APM, App Search, Workplace Search, Security, and Maps",
      },
      {
        "li": "Canvas & Lens",
      },
      {
        "li": "And more"
      }
    ]
  },
  {
    "key": "gold-package",
    "header": "Gold",
    "title":"Great place to start small projects",
    "subtitle":"AS LOW AS",
    "amount":"$28 /month",
    "backgroundColor":"linear-gradient(to top right, #1A329E, #95A6EE)",
    "buttonTitle": "Choose Plan",
    "buttonStyle": {
    },
    "bodyContent": [
      {
        "li": "Core Elastic Stack security features",
      },
      {
        "li": "Capabilities such as Elastic APM, App Search, Workplace Search, Security, and Maps",
      },
      {
        "li": "Canvas & Lens",
      },
      {
        "li": "And more"
      }
    ]
  },
  {
    "key": "platinum-package",
    "header": "Platinum",
    "title":"Great place to start small projects",
    "subtitle":"AS LOW AS",
    "amount":"$28 /month",
    "backgroundColor":"linear-gradient(to top right, #1A329E, #95A6EE)",
    "buttonTitle": "Choose Plan",
    "buttonStyle": {
    },
    "bodyContent": [
      {
        "li": "Core Elastic Stack security features",
      },
      {
        "li": "Capabilities such as Elastic APM, App Search, Workplace Search, Security, and Maps",
      },
      {
        "li": "Canvas & Lens",
      },
      {
        "li": "And more"
      }
    ]
  },
  {
    "key": "enterprise-package",
    "header": "Enterprise",
    "title":"Great place to start small projects",
    "subtitle":"AS LOW AS",
    "amount":"$28 /month",
    "backgroundColor":"linear-gradient(to top right, #1A329E, #95A6EE)",
    "buttonTitle": "Choose Plan",
    "buttonStyle": {
    },
    "bodyContent": [
      {
        "li": "Core Elastic Stack security features",
      },
      {
        "li": "Capabilities such as Elastic APM, App Search, Workplace Search, Security, and Maps",
      },
      {
        "li": "Canvas & Lens",
      },

    ]
  },

]


const planNameStyles={
  display:'flex',
  justifyContent:'center',
  fontWeight:'normal',
  color:'white',
  fontSize:'25px',
  paddingTop:'10px',
  textTransform:'uppercase',

  // marginTop:'5px',
}

const titleStyles={
  display:'flex',
  justifyContent:'center',
  fontWeight:'normal',
  color:'white',
  fontSize:'15px',
  // marginTop:'5px',
}

const amountStyles={
  display:'flex',
  justifyContent:'center',
  fontWeight:'normal',
  color:'white',
  fontSize:'25px',
  // marginTop:'25px',
  // marginBottom:'20px'
}

const listStyles={
  fontSize:"15px",
  color:'white',
  listStyleType:'none',
  textAlign:'left',
  paddingRight:'20px'
}

const buttonStyles={
  fontSize:'20px',
  marginBottom:'30px',
  borderRadius:'25px',
  backgroundColor:'white',
  paddingRight:'60px',
  paddingLeft:'60px',
  paddingTop:'5px',
  paddingBottom:'5px',
  color:'#008F69'
}

const buttonPosition={
  // display:'flex',
  marginLeft:'50px',
  marginTop:"100px",
  justifyContent:'flex-end',
  alignItems:'baseline'
};


function App() {
  return (
    <div>
     <PriceCardDisplayV
     pricingTable={pricingTable}
     titleStyles={titleStyles}
     planNameStylesStyles={planNameStyles}
     amountStyles={amountStyles}
     listStyles={listStyles}
     buttonStyles={buttonStyles}
     buttonPosition={buttonPosition}
     />
    </div>
  );
}

export default App;
